import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Shop from './components/Shop/Shop';
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
} from "react-router-dom";


function App() {
  return (
    <div>
      <Header></Header>
      <BrowserRouter>    
      <Routes>
        <Route path="/shop" element={<Shop/>}>
        </Route>
      </Routes>
      </BrowserRouter>   


    </div>
  );
}


export default App;
